let lineLength = 20;

let x = 800;
let y = 210;

function getById(id) {
    return document.getElementById(id);
}

let dragonCurveCanvas = getById("dragonCurveCanvas");
let ctx = dragonCurveCanvas.getContext("2d");
ctx.strokeStyle = "red";

function drawDragonCurve(item) {

    ctx.beginPath();
    ctx.moveTo(x, y);
    if (item === 0) {
        y = (y - lineLength);
    } else if (item === 1) {
        x = (x + lineLength);
    } else if (item === 2) {
        y = (y + lineLength);
    } else if (item === 3) {
        x = (x - lineLength);
    }
    ctx.lineTo(x, y);
    // ctx.rect(x, y, lineLength, lineLength);
    ctx.stroke();
}

function resetXandY() {
    x = 800;
    y = 210;
}

dragonCurve.forEach(drawDragonCurve);
resetXandY();
ctx.strokeStyle = "black";
dragonCurve90CW.forEach(drawDragonCurve);
resetXandY();
ctx.strokeStyle = "blue";
dragonCurve180CW.forEach(drawDragonCurve);
resetXandY();
ctx.strokeStyle = "green";
dragonCurve270CW.forEach(drawDragonCurve);